import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";
import { Link } from "react-router-dom";

function NewTicketForm() {
  return (
    <>
      <IndexNavbar />

      <div style={containerStyle}>
        <div style={cardStyle}>
          <div style={headerStyle}>
            <h2 style={titleStyle}>Créer un nouveau ticket</h2>
            <Link to="MyTickets">
              <button style={backButtonStyle}>← Retour</button>
            </Link>
          </div>

          <div style={formStyle}>
            <div style={groupStyle}>
              <label style={labelStyle}>Sujet</label>
              <input
                type="text"
                placeholder="Ex : Problème avec l'application mobile"
                style={inputStyle}
              />
            </div>

            <div style={groupStyle}>
              <label style={labelStyle}>Département</label>
              <select style={inputStyle}>
                <option>IT - Informatique</option>
                <option>RH - Ressources Humaines</option>
                <option>Comptabilité</option>
              </select>
            </div>

            <div style={groupStyle}>
              <label style={labelStyle}>Type de ticket</label>
              <select style={inputStyle}>
                <option>Urgent</option>
                <option>Normal</option>
                <option>Faible priorité</option>
              </select>
            </div>

            <div style={groupStyle}>
              <label style={labelStyle}>Description</label>
              <textarea
                rows="5"
                placeholder="Décrivez votre demande ici..."
                style={textareaStyle}
              />
            </div>

            <div style={buttonContainer}>
              <button style={submitButtonStyle}>Créer le ticket</button>
            </div>
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles
const containerStyle = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  minHeight: "90vh",
  backgroundColor: "#f5f7fa",
  padding: "2rem",
};

const cardStyle = {
  backgroundColor: "#ffffff",
  padding: "2.5rem",
  borderRadius: "12px",
  boxShadow: "0 4px 16px rgba(0,0,0,0.08)",
  width: "100%",
  maxWidth: "600px",
};

const headerStyle = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  marginBottom: "1.5rem",
};

const titleStyle = {
  fontSize: "1.6rem",
  fontWeight: "600",
  color: "#003366",
};

const backButtonStyle = {
  background: "none",
  border: "none",
  color: "#003366",
  fontWeight: "600",
  cursor: "pointer",
};

const formStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "1.2rem",
};

const groupStyle = {
  display: "flex",
  flexDirection: "column",
};

const labelStyle = {
  marginBottom: "0.5rem",
  fontWeight: "500",
  color: "#333",
};

const inputStyle = {
  padding: "0.8rem",
  border: "1px solid #ccc",
  borderRadius: "6px",
  fontSize: "1rem",
  backgroundColor: "#fefefe",
};

const textareaStyle = {
  ...inputStyle,
  resize: "vertical",
  minHeight: "100px",
};

const buttonContainer = {
  display: "flex",
  justifyContent: "flex-end",
};

const submitButtonStyle = {
  backgroundColor: "#003366",
  color: "#fff",
  padding: "0.9rem 1.8rem",
  border: "none",
  borderRadius: "6px",
  fontWeight: "600",
  fontSize: "1rem",
  cursor: "pointer",
};

export default NewTicketForm;
